INSERT INTO `article` VALUES (5,'保已成业 防未来非','图未就之功，不如保已成之业；<br />\r\r\n悔既往之失，不如防将来之非。<br />','与其谋划没有把握完成的功业，不如维护已经完成的事业；<br />\r\r\n与其懊悔以往的过失，不如好好预防未来可能发生的错误。<br />','成就事业的人，不会忘记过去。他们从过去的经历中总结出经验教训，但他们绝不会停留在过去。总结过去是为了现在和将来。人能把握的，永远只是现在，要考虑如何把今天的事办好，为明天打下基础。良好的心态是不为已打碎的花瓶哭泣，不为没有含到口或拿到手的香糖迷惑。陀思妥耶夫斯基说：“除了含在口里的和拿在手里的，一切都是假的。<br />','2014-04-27 12:44:55'),(6,'良药苦口 忠言逆耳','<p style=\"color:#555555;font-family:Georgia, \'Times New Roman\', Times, serif;font-size:18px;background-color:#FFFFFF;\">\r\r\n	耳中常闻逆耳之言，心中常有拂心之事，才是进德修行的砥石。\r\r\n</p>\r\r\n<p style=\"color:#555555;font-family:Georgia, \'Times New Roman\', Times, serif;font-size:18px;background-color:#FFFFFF;\">\r\r\n	若言言悦耳，事事快心，便把此生埋在鸩毒中矣。\r\r\n</p>','<span style=\"color:#555555;font-family:Georgia, \'Times New Roman\', Times, serif;font-size:18px;line-height:27px;background-color:#FFFFFF;\">耳中假如能经常听些不爱听的话，心里经常想些不如意的事，这些都像是敦进品德有益身心的磨刀石一样。反之，假如每句话都很好听，每件事都很称心， 那就等于把自己的一生葬送在毒药中了。</span>','<span style=\"color:#555555;font-family:Georgia, \'Times New Roman\', Times, serif;font-size:18px;line-height:27px;background-color:#FFFFFF;\">能否听进逆耳之言，是判断一个人是在上进还是停滞的标志。人在躬行上进时，总是保持高度警惕，遇到虽逆耳但有益事业的事的话，总是认认真真践行。 反之，一个人一旦自以为是，不愿听逆耳之言，他的事业就开始停滞。刘邦，虽鄙视儒生，见之便臭骂为“酸、腐、狗、小”，然而大事从不糊涂，总是认真听取手下之言，终得统一大业。 项羽，刚愎暴虐，连忠心耿耿的亚父范增之言也抛之脑后，终落得“四面楚歌”，无颜面对江东父老，自刎乌江。</span>','2014-04-27 12:48:26'),(7,'坎坷世道 耐而撑持','<p>\r\r\n	<span style=\"font-size:14px;\">语云：”登山耐侧路，踏雪耐危桥。“一耐字极有意味。</span>\r\r\n</p>\r\r\n<p>\r\r\n	<span style=\"font-size:14px;\">如倾险之人情，坎坷之世道，若不得一耐字</span><span style=\"font-size:14px;\">撑持过去，几何不坠入</span><span style=\"font-size:14px;\">榛莽坑堑哉？</span>\r\r\n</p>','<p>\r\r\n	<span style=\"font-size:14px;\">俗语说：“登山要耐得住斜坡上的考验，走雪路要耐得起过危桥的惊险。”</span>\r\r\n</p>\r\r\n<span style=\"font-size:14px;\">可见这一个耐字具有深长意义，正像是险诈好邪的人世情，坎坷不平的人生 路，假如没有这一个“耐”字苦撑下去，有几具会不堕落到杂草丛生的深沟 里呢？</span><br />','<p>\r\r\n	<span style=\"font-size:14px;\">只有经得起痛苦煎熬的人才能创造大事业，即便在日常生活中，平凡小事，也没有那么多顺心如意的。要耐困苦，耐空寂，还得耐心酸，耐侮辱。</span>\r\r\n</p>\r\r\n<p>\r\r\n	<span style=\"font-size:14px;\">诗人说：”为了生存，你得留下屈辱的泪水。“人生之路，不可尽退，如逆水行舟，耐住劲儿，咬咬牙，便一重关隘又在回首处，一阵波浪又在用力撑持中消失。</span>\r\r\n</p>','2014-05-06 14:41:20'),(8,'自薄而厚 先严后宽','<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\">恩宜自淡而浓，先浓后淡 者，人忘其惠；威宜自严而 宽，先宽后严者，人怨其酷。</span>','<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\">对人施予恩惠应该从淡到浓，如 果开始浓厚而逐渐淡薄，那么人们就 容易忘掉你的恩惠；树立威信要先严 格而后宽容，如果先宽容而后严格，人 们就会怨恨你的冷酷。</span>','最理想的待人方法就是“先严后宽”，“先淡后浓”，从事管理、设置个人前程均应如此。<span style=\"color:#333333;font-family:arial, 宋体, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\">有一种人，当他对人好时， 恨不得掏心挖肺，一旦不称其心，则视如路人。这其实是一种愚蠢的做法，往往好心无好报。 先吃美味佳肴，后吃粗茶淡饭， 就难以下咽；反之就觉得这餐饭吃得很香甜。从事管理工作 以及人际交往也应如此。常说 “恩威并用”或“宽严兼施”，其 实最理想的待人方法就是“ 先严而后宽”、“先淡而后浓”。</span>','2015-01-11 03:53:40');
